import React from 'react';
import {
    MDBCarousel,
    MDBCarouselInner,
    MDBCarouselItem,
    MDBCarouselElement,
    MDBCarouselCaption,
  } from 'mdb-react-ui-kit';
  import LandingPageCards from './LandingPageCards';
  import LandingPageCards1 from "./LandingPageCards1";
import LandingPageCards2 from "./LandingPageCards2";
import LandingPageCards3 from "./LandingPageCards3";
import LandingPageCards4 from "./LandingPageCards4";
  import CardSingle from "./CardSingle";

function CardSlider() {
    return (
        <div>
            <MDBCarousel showIndicators showControls fade interval={10000}>
      <MDBCarouselInner>
        <MDBCarouselItem itemId={0}>
          
          <MDBCarouselElement><LandingPageCards /></MDBCarouselElement>
          
        </MDBCarouselItem>

        <MDBCarouselItem itemId={1}>
        <MDBCarouselElement><LandingPageCards1 /></MDBCarouselElement>
          
        </MDBCarouselItem>

        <MDBCarouselItem itemId={2}>
        <MDBCarouselElement><LandingPageCards2 /></MDBCarouselElement>
          
        </MDBCarouselItem>
      </MDBCarouselInner>
    </MDBCarousel>
        </div>
    )
}

export default CardSlider
